import React, { useState, useEffect } from "react";
import "../styles/work.css";
import Navbar from "../components/Navbar";

function Work() {
  const [images, setImages] = useState([]);

  useEffect(() => {
    const sampleImages = Array.from({ length: 100 }, (_, index) => {
      const fileNumber = index + 1;
      const extension = fileNumber <= 7 ? "jpeg" : "png"; // 1-7 are .jpg, rest are .png
      return `/assets/output/${fileNumber}.${extension}`;
    });

    setImages(sampleImages);
  }, []);

  return (
    <>
      <Navbar page="OUR WORK" />
      <div className="work-gallery">
        {images.map((img, index) => (
          <img key={index} src={img} alt={`Work ${index + 1}`} className="work-image" />
        ))}
      </div>
    </>
  );
}

export default Work;
